import React, {Component} from 'react';
import {View, Text, StyleSheet, ImageBackground} from 'react-native';

const homeScreenHeaderBackgroundAnim = require("../../assets/images/zombie_homescreen_header_animation.gif")

export default class HomeScreen extends Component{
    render(){
        return(
            <View style={styles.container}>
                <View style={styles.header}>
                    <ImageBackground src={homeScreenHeaderBackgroundAnim} style={styles.headerBackgroundImage}>
                        <View>
                            <Text style={styles.headerText}>Rapid Survival</Text>
                        </View>
                    </ImageBackground>                       
                </View>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    container: {
        backgroundColor:'#00aee8',
        flex:1
    },
    header: {
        flex:0.15,
        backgroundColor:'red',
        justifyContent: 'center',
        alignItems: 'center'
    },
    headerText: {
        fontSize:40,
        color:'rgba(200,255,0,0.7)',
        fontWeight:'bold'
    },
    headerBackgroundImage:{
        flex:1,
        resizeMode:'cover',
        alignItems: 'center',
        justifyContent: 'center'
    }
})
